import React from 'react';
import '../../App.css';
import HeroSection from '../HeroSection';
import './Education.css';

export default function Education() {
  return (
    <><h1 className='Projects'>EDUCATION</h1><div className="education-main">
      <div className="ASU_WRAP">
        <div className="ASU">
          <img src="images/asu.jpg" width = "50px"></img>
          <div>
            <h3>Arizona State University &middot; Master's in Robotics and Autonomous Systems Engineering </h3>
            <b> Aug 2022 -May 2024</b>
            <hr/>
            <div className= "Projects">
              <div className="project-item">
                <h2>Stereo Image Depth Estimation using U-Net feature extraction.</h2>
                <b>Developed stereo depth estimation on the KITTI2012 dataset using U-Net feature extraction and conducted experiments to finetune the results by optimizing the hyperparameters.Improved the feature extraction of base model using qualitative results and reduced the loss of validation data by 14%</b>
              </div>
            </div>
          </div>
        </div>
      </div>
     
    </div></>
  );
}
